import TextField from '@mui/material/TextField';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import './App.css';

function App() {
  return (
    <div className="App">
      <>
        <Box
          component="form"

          noValidate
          autoComplete="off"
        >
          <TextField id="outlined-basic" label="Search your recipe" variant="outlined" />

        </Box>
        <Button sx={{ width: "2em" }} variant="contained">Search</Button></>


    </div>
  );
}

export default App;
